import React from "react";
import { Grid, Card } from "@material-ui/core";

function App() {
  return (
    <Grid
      container
      alignItems="center"
      justify="center"
      style={{
        marginTop: "20px",
        boxShadow:
          "0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19)"
      }}
    >
      <Grid item xs={12} sm={12} md={12} lg={6}>
        <Card style={{ height: "calc(100vh - 40px)" }}></Card>
      </Grid>
    </Grid>
  );
}

export default App;
